          </p>
          
        </div>
        <div className="box_product_2">
          <div className="product">
            <CardProduct src="https://res.cloudinary.com/dr9mltwij/image/upload/v1634593559/LADLOLA/Bocadito_Alfajor_xiffgg.jpg" path="/products" />{" "}
          </div>
          <div className="product">
            <CardProduct src="https://res.cloudinary.com/dr9mltwij/image/upload/v1633927405/LADLOLA/tortaQuincea%C3%B1era_qd01rp.png" path="/products" />{" "}
          </div>
        </div>
    </div>
    </>
  );
};
